jQuery.noConflict();jQuery(document).ready(function($){	$(window).scroll(function() {		var diff = $(window).scrollTop(),		collection6_elementOffset = $('.collection6').offset().top,			collection6_distance = 0.05*(collection6_elementOffset - diff);					//console.log($('.collection5'));			//console.log($('.collection6'));					if(collection6_distance  < 50 && collection6_distance  > -100){			$('.collection6:eq(0) img.moves-left').css('margin-left',-50 - collection6_distance  );			//$('.collection5 img.moves-left').css('margin-left',-50 - collection5_distance_1 );		}			});	});